import { createStore, combineReducers } from 'redux';
import reducer from '../reducers';

const store = createStore(reducers = combineReducers({ reducer }), window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());

export default store;
